import React, { Component } from 'react';
import {bindActionCreators} from 'redux';
import {connect} from 'react-redux';
import {selectUser, removeUser} from './actions/index';
import Link from 'next/link'

class HomePage extends Component {
  render() {
    return (
      <div>
        {/* {this.props.users.map((article,index) => <li key={index} onClick= {()=> this.props.removeUser(article)}>{article.id}{article.name} </li>)} */}
      </div>
    );
  }
}

function mapStateToProps(state) {
    return {
      users: state.users
    }
}

function matchDispatchToProps(dispatch){
  return bindActionCreators({removeUser: removeUser}, dispatch)
}

// function matchDispatchToProps1(dispatch){
//   return bindActionCreators({removeUser: removeUser}, dispatch)
// }

export default connect(mapStateToProps,matchDispatchToProps)(HomePage);
